import React from "react";
import Card from "./Card";
import Netflix from "./Netflix";
import Sdata from "./sdata";


const favseries = 'netflix';

const FavS = () =>
{


if(favseries){
    return <Netflix/>;

}
else{
    return(
          
        <Card
          key={Sdata[3].id}
         imgsrc ={Sdata[3].imgsrc}
         
    title =  {Sdata[3].title}
    sname ={Sdata[3].sname}
    link ={Sdata[3].link}
/>

    );

}
};

const Net =()=>
(
    <div>

    <h1 className ="heading_style">List of top 5 Netflix in 2020</h1>
    <FavS/>
   
    </div>
   
   
    );

    export default Net;
